INSERT INTO `products` VALUES (1,'APPLE iPhone X','1212121','14900000','10','iphone-X-1.jpg','iphone-X-2.jpg','iphone-X-3.jpg','The iPhone X is Apple\'s new flagship 10th anniversary iPhone featuring a 5.8-inch OLED display, facial recognition and 3D camera functionality, a glass body, and an A11 Bionic processor.','5.8\" OLED display','Faster A12 Bionic processor','Edge-to-edge display','Facial Recognition','Apple','1'),(2,'APPLE iPhone 8','11999000','9900000','6','iphone8-1.jpg','iphone8-2.jpg','iphone8-3.jpg','The iPhone 8 is the eighth generation of Apple\'s popular iPhone mobile smartphone device which retain the Retina HD Display  with True Tone technology and features a 12 MP camera with autofocus, f/1.8 aperture and optical image stabilization.','4.7-inch LCD display','Faster A11 processor','Glass body','Upgraded camera','Apple','1'),(4,'SAMSUNG Galaxy S9','11499000','9889000','2','s9-1.jpg','s9-2.jpg','s9-3.jpg','Galaxy S9 produced by Samsung Electronics which is feature 1440p Super AMOLED displays, with an 18.5:9 aspect ratio, 5.8-inch panel, with a Samsung Exynos 9810 processor 4GB RAM, and Dual Aperture rear camera which can switch between f/1.5 and f/2.4.','5.80-inch AMOLED display','Octa-core Qualcomm Snapdragon 845 processor','12-MP camera on the rear and an 8-MP front','64GB of internal storage','Samsung','1'),(6,'SAMSUNG Galaxy Note 9','13499000','12649000','6','note9-1.jpg','note9-2.jpg','note9-3.jpg','Samsung Galaxy Note 9 smartphone was launched in August 2018 comes with a 6.40-inch touchscreen display with a resolution of 1440 pixels by 2960 pixels which is powered by 1.7GHz octa-core processor and it comes with 6GB of RAM.','6.40-inch AMOLED display','1.7GHz octa-core processor, 6GB of RAM.','12-MP camera on the rear and an 8-MP front','Powered by a 4000mAh','Samsung','1'),(7,'Samsung Galaxy S8 Active','7999000','7275000','9','S8-Active-1.jpg','S8-Active-2.jpg','S8-Active-3.jpg','Get the ultra-tough Samsung Galaxy S8 Active on America’s Best Unlimited Network. Whether you’re an outdoor adventurer, a busy mom, or work in harsh or outdoor environments, the Galaxy S8 Active features absolute durability for your daily life. The Galaxy S8 Active is compatible with Extended Range LTE – 600 MHz with a signal so powerful that it can penetrate walls for 4X better in-building coverage.','Large 5.8” WQHD ','Long lasting 4,000mAh battery life ','Enjoy the durability of IP68','Rugged Design','Samsung','1'),(8,'SAMSUNG Galaxy J6','2799000','2265000','5','J6-1.jpg','J6-2.jpg','J6-3.jpg','The Samsung Galaxy J6 features a 1480p Super AMOLED display, with an 18:5:9 aspect ratio, the ‘Infinity Display’ and a 5.6-inch panel, having around ~76.5% screen-to-body ratio.','Live colorful with sAMOLED display','Fluidity and style','1.6GHz CPU Speed','Multitask-ready display','Samsung','1'),(9,'SAMSUNG Galaxy J4','1999000','1799000','7','J4-1.jpg','J4-2.jpg','J4-3.jpg','The Samsung Galaxy J4 sports a standard 5.5-inch AMOLED display which has 14nm Exynos 7570 chipset powers the device, the chip includes four Cortex-A53 cores running at a clock speed of 1.4GHz, made for entry-level handsets, ','5.50-inch AMOLED display','Exynos 7570 Quad Core','Battery 3.000 mAh ','Face Recognition, Samsung Max, Signal Max, Selfie Focus','Samsung','1'),(10,'OPPO F9','0','4999000','10','oppo-F9-1.jpeg','oppo-F9-2.jpeg','oppo-F9-3.jpeg','The OPPO F9 features a waterdrop notch design, equipped with VOOC fast charging technology, powered by a 2GHz octa-core processor, and has 4/6GB of RAM and 64GB of storage which is operates on ColorOS 5.2 which is a customized version of Android 8.1 (Oreo)','25MP Front Camera with Sensor HDR','4/6GB RAM+ 64GB ROM','Waterdrop 6.3-inci FHD+ ','Powerful Performance','OPPO','1'),(11,'OPPO Find X','0','13499000','43','oppo-Find-X-1.jpeg','oppo-Find-X-2.jpeg','oppo-Find-X-3.jpeg','The Oppo Find X is the 2018 flagship smartphone from the Oppo Find series, which is powered by Qualcomm Snapdragon 845 processor, 8 GB of RAM, 256 GB of storage and has pop up contains both the 25 MP front camera and dual 16 + 20 MP rear cameras.','6.4-inch AMOLED display','Qualcomm Snapdragon 845','3730mAh (TYP) for VOOC','ColorOS 5.1, based on Android 8.1','OPPO','1'),(12,'XIAOMI Mi Mix 2','12999000','7099000','54','xiaomi-mi-mix2-1.jpeg','xiaomi-mi-mix2-2.jpeg','xiaomi-mi-mix2-3.jpeg','Xiaomi Mi MIX 2 is an Android phablet manufactured by Xiaomi, which is powered by the Qualcomm Snapdragon 835 processor, with either 6 or 8 GB LPDDR4X RAM, has a 5.99 inches (152 mm) 1080p IPS LCD display, and features a 4-axis OIS camera system.','5.99\" display 18:9 aspect ratio','Snapdragon 835','Large 6GB RAM','Dual ADC HD voice recording','Xiaomi','1'),(13,'XIAOMI Mi A1','3199000','3099000','6','xiaomi-mi-A1-1.jpeg','xiaomi-mi-A1-2.jpeg','xiaomi-mi-A1-3.jpeg','With the Xiaomi Mi A1, you get a dual rear camera setup. One of the sensors sports a wide-angle lens, while the other is equipped with a telephoto lens. Further, the two cameras also let you take bokeh shots. If that wasn’t cool enough, you also get unlimited storage on Google Photos.','12MP + 12MP | 5MP Front Camera','Snapdragon 625 64 bit Octa Core 2GHz','3080 mAh Li-polymer Battery','Android One','Xiaomi','1'),(14,'XIAOMI Redmi 6A','1900000','1388000','8','redmi-6a-1.jpeg','redmi-6a-2.jpeg','redmi-6a-3.jpeg','Redmi 6 smartphone was launched in June 2018, the phone comes with a 5.45-inch touchscreen display with a resolution of 720 pixels by 1440 pixels is powered by 2GHz octa-core processor and it comes with 3GB of RAM','5.45\" Full Screen Display','Up to 2.0GHz high performance processor','13MP camera','AI face unlock','Xiaomi','1'),(15,'XIAOMI Black Shark','9999000','7599000','5','xiaomi-black-1.jpg','xiaomi-black-2.jpg','xiaomi-black-3.jpg','Xiaomi Black Shark smartphone was launched in April 2018, the phone comes with a Snapdragon 845 processor, a 5.99-inch touchscreen display with a resolution of 1080 pixels by 2160 pixels which is powered by 2.8GHz octa-core processor and it comes with 6GB of RAM.','5.99 inches, 1080 x 2160 px Display','12 MP Dual Rear + 20 MP Front Camera','8 GB RAM, 128 GB inbuilt','4000 mAh Battery','Xiaomi','1'),(16,'APPLE Macbook Pro 2018','26399000','25799000','9','macbook-pro-13-1.jpg','macbook-pro-13-2.jpg','macbook-pro-13-3.jpg','MacBook Pro elevates the notebook to a whole new level of performance and portability, wherever your ideas take you, you’ll get there faster than ever with high‑performance processors and memory, advanced graphics, blazing‑fast storage, and more.','15.4-inch (diagonal) LED-backlit display','2.8GHz quad-core Intel Core i7','256GB PCIe-based onboard SSD','16GB of 2133MHz LPDDR3 onboard memory','Apple','2'),(17,'APPLE Macbook Air 2017','13349000','12399000','5','macbook-air-1.jpg','macbook-air-2.jpg','macbook-air-3.jpg','MacBook Air lasts up to an incredible 12 hours between charges. So from your morning coffee till your evening commute, you can work unplugged. When it’s time to kick back and relax, you can get up to 12 hours of iTunes movie playback','13.3-inch (diagonal) LED-backlit ','128GB PCIe-based SSD','1.8GHz dual-core Intel Core i5','8GB of 1600MHz LPDDR3 onboard memory','Apple','2'),(18,'ASUS Zenbook Flip S','24999000','23299000','3','zenbook-flip-S-1.jpg','zenbook-flip-S-2.jpg','zenbook-flip-S-3.jpg','The ASUS ZenBook Flip S has a premium look with a design that is suitable for use on various occasions, whether for business needs, school or your personal needs and can accommodate the need for a flexible screen to be used at any time.','13.3” LED-backlit Full HD','Integrated Intel® HD Graphics 620','16GB 2133MHz LPDDR3 onboard','512GB PCIe SSD','ASUS','2'),(19,'ASUS ROG GL702VM','29999000','27925000','34','ASUS-ROG-GL503VM-1.jpg','ASUS-ROG-GL503VM-2.jpg','ASUS-ROG-GL503VM-3.jpg','The best quality gaming laptops in the world manufactured by Asus, provides powerful performance and stunning visual gaming, and designed to produce outstanding performance to meet your needs as a gamer.',' 60Hz with G-Sync FHD 17.3\" Panel','Intel® Core™ i7 6700HQ Processor','32 GB DDR4 2133MHz SDRAM','NVIDIA , with 3GB/6GB VRAM GeForce GTX 1060','ASUS','2'),(20,'ASUS A442UR','9599000','9199000','31','asus-a442ur-1.jpg','asus-a442ur-2.jpg','asus-a442ur-3.jpg','Asus presents Notebooks with the A442UR VivoBook 14 series, has a variety of reliable performance that is more optimal at an affordable price and combines very fast hardware performance with an ergonomic and stylish notebook design.','14.0\" (16:9) LED-backlit HD','Intel® Core™ i5 8250U Processor','4 GB DDR4 2133MHz SDRAM','NVIDIA® GeForce® 930MX','ASUS','2'),(21,'ASUS Vivobook S410UN','0','9749000','10','asus-s410un-1.jpg','asus-s410un-2.jpg','asus-s410un-3.jpg','Asus VivoBook S410UN is a notebook that gives you unlimited productivity for you who often travel for meetings outside the city, with a 0.7 inch profile and weighs only 1.31 kg, supported by the latest Intel Core i5-8250U processors and equipped with an NVIDIA GeForce MX150 graphics card.','14.0\" (16:9) LED backlit FHD','Intel® Core™ i5 8250U Processor','8 GB DDR4 2800MHz SDRAM','Integrated Intel® CPU','ASUS','2'),(22,'DELL Inspiron 14-7460','11199000','10225000','42','dell-inspiron-14-7460-1.jpg','dell-inspiron-14-7460-2.jpg','dell-inspiron-14-7460-3.jpg','DELL Inspiron 3567 comes with a concise design that can provide comfort when you bring this product anywhere. You can also comfortably play your favorite games thanks to the graphics and connectivity that are powerful.','14.0-inch FHD (1920x1080) IPS','NVIDIA® GeForce® 940MX with 2 GB GDDR5 graphics memory','7th Generation Intel® Core™ i5-7200U Processor','Up to 32 GB Dual Channel DDR4 2133 MHz','DELL','2'),(23,'DELL Inspiron 11-3180','3899000','3769000','12','dell-inspiron-3180-1.jpg','dell-inspiron-3180-2.jpg','dell-inspiron-3180-3.jpg','DELL Inspiron 3180 comes with a compact design that can provide comfort when you bring this product anywhere. You can also comfortably play your favorite games thanks to the graphics and connectivity that are powerful. The complete port on this product can also provide more flexibility for you so you can be more comfortable doing various activities.','11.6-inch HD (1366 x 768) Anti-Glare LED','7th Generation AMD E2-9000e ','4 GB, DDR4, 2400 MHz','Integrated graphics with AMD APU','DELL','2'),(24,'DELL Inspiron 14-3467','9899000','9349000','57','dell-inspiron-3467-1.jpg','dell-inspiron-3467-2.jpg','dell-inspiron-3467-3.jpg','The DELL Inspiron 3467 comes with a variety of interesting features to help increase your productivity. This laptop comes with an advanced processor with large memory that can minimize obstacles when you run various applications simultaneously. You can also enjoy amazing audio to watch your favorite movies.','14.0-inch HD (1366 x 768) Anti-Glare LED','7th Generation Intel® Core™ i3-7130U Processor','4-12GB, 2400MHz, DDR4, up to 16GB','ntel® HD Graphics 520','DELL','2'),(25,'LENOVO Yoga 520','4999000','4399000','43','lenovo-yoga-520-1.jpg','lenovo-yoga-520-2.jpg','lenovo-yoga-520-3.jpg','Lenovo Yoga 520-14IKB 0VID Laptop - Onyx Black [i5-8250U / 14 Inch / 1TB / 4GB / GT940MX / Win10] is a 2 in 1 laptop with a screen size of 14 Inch, supported by an Intel Core i5-8250U up to 3.4Ghz and Nvidia GeForce GT 940 MX graphics type? 2GB. And has 4GB DDR4 memory, 1TB HDD storage capacity.','14\" FHD (1920 x 1080) IPS ','Intel Core i5-8250U Up to 3.4GHz','Nvidia GeForce GT 940 MX 2GB','4GB DDR4','LENOVO','2'),(26,'LENOVO Ideapad 330S','11999000','9999000','32','lenovo-ideapad-330s-1.jpg','lenovo-ideapad-330s-2.jpg','lenovo-ideapad-330s-3.jpg','IdeaPad 330S is designed to be able to simplify your daily needs to be more efficient and durable. AMD Ryzen processor support used on this laptop is also able to optimize the use of power so that the laptop can be used throughout the day.','14\" FHD (1920 x 1080) IPS ','AMD RyzenTM 7 2700U Processor','NVIDIA® GeForce® GTX1050 4GB DDR5','4GB RAM','LENOVO','2'),(28,'RAZER Blade 14 2017','0','39999000','5','razer-blade-14-1.jpg','razer-blade-14-2.jpg','razer-blade-14-3.jpg','Razer Blade 14 is a gaming laptop that is designed with compact shapes and materials. The performance of this laptop is supported by the 7th generation Intel processor which is able to give you powerful visual and graphic toughness. This laptop is also supported by VRWorks technology that can give you a quality game that is more lively and impressive.','14 inch 16:9, 1920 x 1080 pixel','Processor Intel Core i7-7700HQ ','16GB RAM','NVIDIA GeForce GTX 1060 (Laptop) ','RAZER','2'),(29,'ACER Swift 3 SF314-54G','8499000','8199000','3','acer-swift-3-1.jpg','acer-swift-3-2.jpg','acer-swift-3-3.jpg','A 14-inch notebook with a stylish design that is slim, thin and lightweight for high mobility. Up to 200% better performance with the latest Intel Core processor technology. Battery life of up to 10 hours with a single charge, the longest in its class. Login faster and safely with the fingerprint scanner type touch.','14\" Full HD (1920 x 1080)','Intel Core i7-8550U Processor','2 GB of dedicated GDDR5','NVIDIA GeForce MX150','ACER','2'),(30,'ACER Aspire 3 A315','7599000','7349000','2','acer-aspire-3-1.jpg','acer-aspire-3-2.jpg','acer-aspire-3-3.jpg','CER Aspire 3 comes with a 15.6-inch screen, has maximum performance equipped with AMD Ryzen 5 2500U processor, supporting the quality of your computing. Coupled with AMD Radeon Vega 8 Graphics graphics card with 8GB RAM, feel quality visuals when you stare at the screen to work or play games.','15.6\" Full HD (1920 x 1080)','AMD A-Series Dual-Core Processor ','12GB 2133MHz DDR4 Memory','AMD Radeon R5 Graphics','ACER','2'),(31,'ACER Predator Nitro 5','18199000','17319000','5','acer-gaming-predator-nitro-5-1.jpg','acer-gaming-predator-nitro-5-2.jpg','acer-gaming-predator-nitro-5-3.jpg','ACER Predator Nitro 5 is produced to be able to accommodate your work needs and gaming needs. With the design as a gaming laptop that is easiest to upgrade in its class with a backdoor compartment. Predator Nitro 5 supports upgrading to NVME SSD storage, 111% faster than SSD M.2 SATA storage.','15.6\" Full HD (1920 x 1080)','8th Intel Quad Core i5-8300H Processor 2.3GHz','4 GB of dedicated GDDR5 VRAM','NVIDIA GeForce GTX 1050 ','ACER','2'),(32,'SAMSUNG Chromebook 3','0','6999000','7','samsung-chromebook-3-1.jpg','samsung-chromebook-3-2.jpg','samsung-chromebook-3-3.jpg','SAMSUNG Chromebook 3 is a quality device. Besides that you will expect no less than leading technology brands like Samsung. Everything at your fingertips. Built-in security features ensure you are protected from viruses and malware. Navigate your world with Chrome OS.','11.6” HD anti-reflective Display','Intel Celeron N3060 Processor','Up to 11 hrs. battery life','Spill-resistant keyboard protects','Chromebook','2'),(33,'ACER Chromebook R13','0','5999000','5','acer-chromebook-1.png','acer-chromebook-2.png','acer-chromebook-3.png','Acer Chromebook R13 can function as a versatile laptop whose shape can turn into a tablet. The shape can be rotated up to 360 degrees for the use of a more comfortable and easy to use display. This chromebook screen can also be operated easily thanks to the high-quality touch screen function.','13.3” Full HD Touch Display','MediaTek Quad-Core CPU','4GB Memory','Up to 12-hour Battery Life','Chromebook','2'),(34,'HP Chromebook 14 ','0','6499000','3','hp-chromebook-1.png','hp-chromebook-2.png','hp-chromebook-3.png','The Chromebook 14 is a laptop that can give you more optimal features than you ever imagined. This laptop has a modern design with a variety of colors that can be selected according to your character. This chromebook screen is capable of producing quality images and colors thanks to the support of IPS technology that is convenient for vision.','14.0-inch diagonal HD SVA','Intel(R) Celeron(R) Processor N3350','4 GB LPDDR4-2400 SDRAM','16 GB eMMC','Chromebook','2'),(35,'NINTENDO Switch','5999000','4375000','5','switch-1.jpg','switch-2.jpg','switch-3.jpg','Nintendo Switch + Neon Red and Blue Joy-Con is the latest breakthrough from Nintendo in the form of a video game console that can be played at home or taken on a trip. In addition to being connected to a TV at home, this console can also be a handheld that is connected via a 6.2-inch screen, making it easy to carry to play wherever you want.','1280 x 720 (portable) 1920 x 1080 (console)','Nvidia customized Tegra processor','32GB flash storage','4GB RAM','NINTENDO','3'),(36,'NINTENDO New 3DS XL','3200000','2825000','8','3dsxl-1.png','3dsxl-2.png','3dsxl-3.png','This is the latest version of Nintendo 3DS XL which offers an increase in various factors to increase comfort and excitement in playing. Nintendo New 3DS XL carries a new and faster processor, a 3D screen that features Face-tracking, a new button, and a better camera when used in low light conditions.','3D Paralax Screen',' 804 MHz ARM11 MPCore quad-core',' 256MB FCRAM, 10MB VRAM','  4x VFPv2 Co-Processor','NINTENDO','3'),(37,'NINTENDO New 2DS XL','2999000','2599000','4','2ds-xl-1.png','2ds-xl-2.png','2ds-xl-3.png','New Nintendo 2DS XL is a classic gaming product that is given a modern touch and enhancement from various aspects. From a physical standpoint, this Nintendo has a 82% larger screen size than the previous generation. Although called 2DS, Nintendo can play all DS, DSi, and 3DS versions of the game at once.','Clamshell design','Compatible All 3DS Games',' 804 MHz ARM11 MPCore quad-core',' 256MB FCRAM, 10MB VRAM','NINTENDO','3'),(38,'SONY Playstation 4','4999000','4575000','8','ps4-1.png','ps4-2.png','ps4-3.png','The best console in the world now has a new look. Feel an exciting adventure, fight with the best players online and challenge your friends in your living room with this new slimmer and lighter PS4!','GPU : 1.84 TFLOPS, AMD Radeon™','CPU : x86-64 AMD “Jaguar”, 8 cores','GDDR5 8GB','500GB Storage','SONY','3'),(39,'SONY Playstation 4 Pro','7499000','6199000','4','ps4-pro-1.jpg','ps4-pro-2.jpg','ps4-pro-3.jpg','Feel the gaming experience that is second to none with PS4 Pro. With a 4K display, each game will feel more alive because of the color support and clarity that detail in each image. PS4 Pro is packed with excellent power. Designed with advanced and advanced technology to provide a true gaming experience.','2.1GHz x86 AMD Jaguar eight-core','4.2 teraflops (TFLOPS)','8GB GDDR5 RAM','1TB 2.5-inch','SONY','3'),(40,'MICROSOFT XBOX One X','9999000','6999000','9','xbox-one-x-1.jpg','xbox-one-x-2.jpg','xbox-one-x-3.jpg','Xbox One X is a special edition console and controller that you can use for impressive game sessions. This Xbox One X console is made with a distinctive exclusive design. You can also enjoy impressive visual functions thanks to Blu-ray player support and 4K quality video streaming functions.','2.3GHz 8-core AMD Custom CPU','1.172GHz AMD Custom GPU','12GB GDDR5','1TB HDD','MICROSOFT','3');
